                <a href={require ('../assets/images/bg-1.jpg')}><img src={require ('../assets/images/bg-1.jpg')} alt='An image of Prateek Balani'/></a>
            </div>
            <div className='profile-text'>

            </div>
        </div>


        </>


    );

}

export default About;
